    true,nt"url": null,nt"notes": "<p>Hospital Outpatient Prospective Payment
    System (OPPS) Limited Data Set<br />nThis file contains select claim level data
    and is derived from 2010 hospital outpatient PPS claims, updated through June 2011,
    that is, claims for services furnished on or after January 1, 2010 through December
    31, 2010 that were received, processed, paid, and passed to the National Claims
    History file by June 30, 2011.  This file includes data elements such as diagnosis
    codes, bill type, outlier payments, and service revenue payments. This file includes
    more than 64 million claims for services paid under the OPPS, including multiple
    and single claims.  The  record length is 11,783, blocksize is 32,760.</p>n",nt"license_title":
